  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is available as a downloadable
  file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map,
  Cross Section image, Isopach map, Block diagram image, and a text on the Bedrock
  geology of Central Champlain Valley of Vermont. For more information see links provided.
  Abstract: The autochthonous rocks exposed within the Central Champlain Valley range
  from the Trempealeauian Ticonderoga dolostone through  the Middle Ordovician Iberville
  shale. The sequence is continuous with no apparent interruptions in deposition;
  possibly a paraconformity exists between the Bridport dolostone and the Chazvan
  Day Point formation.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
